import React from 'react';
import { View, Text, Button, StyleSheet, StatusBar } from 'react-native';

const Deliveries = ({ deliveries }) => {

  return (

    pendentDeliveries.map((prop, key) => {
      return (
        <TouchableOpacity style={styles.loginBtn} onPress={() => navigation.navigate('Delivery')}>
          <Text style={styles.loginText}>Delivery No929I293I23</Text>
        </TouchableOpacity>
      );
    })
  );
};

export default Deliveries;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    paddingTop: 20,
    paddingBottom: 20,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  }
});
